import React, { useState, useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { useParams } from 'react-router-dom';
import { Typography } from '@mui/material';
import { styled } from '@mui/system';
import { Link } from 'react-router-dom';
import { Document, Page, pdfjs } from 'react-pdf';
import useAxiosPrivate from '../hooks/useAxiosPrivate';

pdfjs.GlobalWorkerOptions.workerSrc = `https://cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;



const View = () => {
    const { id } = useParams();
    const axiosPrivate = useAxiosPrivate();

    const [searchRes, setSearchRes] = useState([]);
    const [fileContents, setFileContents] = useState({});
    const [numPages, setNumPages] = useState(null);


    const getFileContent = async (fileName,menuId) => {
        try {
            const response = await axiosPrivate.get(`http://localhost:8080/files/${fileName}/menu/${menuId}`);
            if (response.ok) {
                return await response.text();
            } else {
                console.error('Error retrieving file content:', response.status);
                return '';
            }
        } catch (error) {
            console.error('Error fetching data:', error);
            return '';
        }
    };

    const getExtension = (path) => {
        const baseName = path.split(/[\\/]/).pop();
        const pos = baseName.lastIndexOf('.');
        if (baseName === '' || pos < 1) {
            return '';
        }
        return baseName.slice(pos + 1);
    };

    const url = `http://localhost:8080/search/${id}`;
    useEffect(() => {
        const getData = async () => {
            try {
              const response = await axiosPrivate.get(url);
              setSearchRes(response.data);
            } catch (error) {
              console.error('Error fetching search results:', error);
            }
          };
      
          getData();

        const fetchFileContents = async () => {
            const fileContentPromises = searchRes.map((item) =>
                getFileContent(item.fileName,item.menu.menuId)
            );

            const fileContentsArray = await Promise.all(fileContentPromises);

            const fileContentsMap = searchRes.reduce(
                (acc, item, index) => ({
                    ...acc,
                    [item.fileName]: fileContentsArray[index],
                }),
                {}
            );

            setFileContents(fileContentsMap);
        };

        fetchFileContents();
    }, [searchRes, id]);

    const renderFile = (item) => {
        const extension = getExtension(item.filePath);
        const fileUrl = `http://localhost:8080/files/${item.fileName}/menu/${item.menu.menuId}`;

        switch (extension) {
            case 'txt':
                console.log(fileUrl);
                return <pre>{fileContents[item.fileName]}</pre>;
            case 'jpg':
            case 'jpeg':
            case 'png':
                console.log(fileUrl);
                return <img src={fileUrl} alt={item.fileName} />;
            case 'mp4':
                console.log(fileUrl);
                return (
                    <video controls>
                        <source src={fileUrl} type="video/mp4" />
                    </video>
                );
            case 'mp3':
                console.log(fileUrl);
                return (
                    <audio controls>
                        <source src={fileUrl} type="audio/mpeg" />
                    </audio>
                );
            case 'pdf':
                console.log(fileUrl);
                return (
                    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                        <Document file={fileUrl} onLoadSuccess={({ numPages }) => setNumPages(numPages)}>
                            {Array.from(new Array(numPages), (_, index) => (
                                <Page key={`page_${index + 1}`} pageNumber={index + 1} width={window.innerWidth * 0.8} />
                            ))}
                        </Document>
                    </div>
                );
            case 'docx':
                console.log(fileUrl);
                return (
                    <iframe src={`https://view.officeapps.live.com/op/embed.aspx?src=${fileUrl}`} width="100%" height="600px" frameBorder="0" />
                );
            case 'xlsx':
                console.log(fileUrl);
                return (
                    <iframe src={`https://view.officeapps.live.com/op/embed.aspx?src=${fileUrl}`} width="100%" height="600px" frameBorder="0" />
                );
            default:
                return <Typography>Unsupported file format</Typography>;
        }
    };

    return (
        <div>
            {searchRes.map((item) => (
                <div key={item.id}>
                    {renderFile(item)}
                </div>
            ))}
        </div>
    );
};

export default View;
